import React from "react";
import { useQuery } from "@apollo/client";
import { QUERY_USERS } from "../utils/queries";

export default function TeamCard() {
  const { loading, userData } = useQuery(QUERY_USERS);

  return (
    <ul className="list-group mt-2" data-bs-theme="dark">
      {userData.map((user) => {
        return (
          <div key={user._id}>
            <li className="list-group-item">
              <img src={user.image} className="teamImg"></img>
              {user.username}
            </li>
          </div>
        );
      })}
    </ul>
  );
}
